import { useEffect, useState } from "react";
import { Link, Switch, Route } from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";
import { getBranchList } from "./services/branch";
import { useNavigate } from "react-router-dom";
import { toast } from "react-toastify";

function Admin() {
  const [branchs, setBranchs] = useState([]);
  const navigate = useNavigate();
  const Add = () => {
    navigate("/add");
  };
  const Edit = () => {
    navigate("/Edit");
  };
  const EmpList = () => {
    navigate("/EmpList");
  };
  useEffect(() => {
    // get the list of products from server
    loadBranch();
  }, []);

  const loadBranch = async () => {
    const response = await getBranchList();
    if (response !==null) {
      setBranchs(response['data']);

    } else {
      toast.error("Error while calling get /product api");
    }
  };

  return (
    <>
      <div className="length">
        <div>
          <table className="table table-bordered">
            <thead>
              <tr className="colr">
                <td>Branch Id</td>
                <td>Branch Name</td>
                <td>Branch Location</td>
                <td>Branch code</td>
                <td>Branch Manager</td>
              </tr>
            </thead>

            <tbody>
              {branchs.map((branch) => {
                return (
                  <tr key={branch.branchId}>
                    <td>{branch.branchId}</td>
                    <td>{branch.branchCode}</td>
                    <td>{branch.branchName}</td>
                    <td>{branch.branchLocation}</td>
                    <td>{branch.branchManager}</td>
                    <td>
                      <button onClick={Edit} className="btn btn-primary">
                        Edit
                      </button>
                    </td>
                    <td>
                      <button class="btn btn-danger">Delete</button>
                    </td>
                    <td>
                      <button onClick={EmpList} className="btn btn-success">
                        Employee List
                      </button>
                    </td>
                  </tr>
                );
              })}
              ;
            </tbody>
          </table>
          <center>
            <button onClick={Add} className="btn btn-primary">
              Add Branch
            </button>
          </center>
        </div>
      </div>
    </>
  );
}
export default Admin;
